(27, 12, 0, 'uk', NULL, '', 'Повернення та гарантія', NULL, NULL, NULL, '&lt;p&gt;&lt;strong&gt;Повернення чи обмін товару&lt;/strong&gt; який не був встановлений на автомобіль та не використовувався приймається на наступних умовах:&amp;nbsp;&lt;/p&gt;\n\n&lt;ol&gt;\n	&lt;li&gt;Наявність чеку чи видаткової накладної (видається при покупці)&lt;/li&gt;\n	&lt;li&gt;Збережений товарний вигляд товару (упакування та етикеток)&lt;/li&gt;\n	&lt;li&gt;З дня купівлі не пройшло 14 днів&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;h3&gt;&amp;nbsp; Повернення бракованого товару чи товару що вийшов з ладу під час гарантійного терміну на неї приймається на наступних умовах:&amp;nbsp;&lt;/h3&gt;\n\n&lt;ol&gt;\n	&lt;li&gt;Наявність чеку чи видаткової накладної (видається при покупці)&lt;/li&gt;\n	&lt;li&gt;Акт рекламації (видається СТО що встановлювала де демонтувала деталь)&lt;/li&gt;\n	&lt;li&gt;Заказ-наряд СТО&lt;/li&gt;\n	&lt;li&gt;Документи СТО&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;strong&gt;Гарантійний термін&lt;/strong&gt; на автозапчастини придбані у нашому магазині встановлюється &lt;strong&gt;від 14 днів до 1 року&lt;/strong&gt;, в залежності від гарантійної політики компанії виробника. З гарантійними умовами можна ознайомитись на сайті виробника, або у менеджера компанії Life Cars.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp; З питань обміну, повернення, можливих гарантійних випадків прошу звертатись особисто в &lt;strong&gt;магазин за адресою м. Львів вул.. Виговського, 49&lt;/strong&gt;, або з відповідними заявами на електрону пошту за адресою &lt;strong&gt;manager@lifecars.com.ua&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp; &amp;nbsp;Увага!!! Звертайому Вашу увагу на те, що гарантії немає на автозапчастини, що містять електрокомпоненти (датчики, насоси, катушки,лямбда зонди, генератори та ін. ).&amp;nbsp;&lt;br /&gt;\nЕлектрообладнання поверненню та обміну непідлягає.&lt;br /&gt;\nПрохання враховувати дані ризики при купівлі автозапчастини, що містять електрокомпоненти.&lt;br /&gt;\n&amp;nbsp;&lt;br /&gt;\nПеред встановленням деталей, що містять електрокомпоненти (датчики, насоси, катушки, лямбда зонди, генератори та ін.) вони мають бути перевірити на спеціалізованій станції до встановлення на автомобіль.&amp;nbsp;&lt;br /&gt;\nУ разі встановлення на автомобіль без попередньої перевірки на спеціалізованій станції претензії щодо гарантії, належної якості товару не розглядаються!!!&lt;/p&gt;\n', NULL, NULL),
