(29, 13, 0, 'uk', NULL, '', 'Оплата та доставка', NULL, NULL, NULL, '&lt;h1&gt;ОПЛАТА&lt;/h1&gt;\n\n&lt;p&gt;&lt;strong&gt;1. Готівкова форма оплати&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;пропонуємо внесення готівкових коштів через касу магазину;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;2. Безготівкова форма оплати&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;для цього потрібно зв&amp;rsquo;язатися з менеджером компанії, після чого Вам буде виставлено рахунок- фактури, та всі супітні документи (зареєстровані як приватний підприємець, працюємо по спрощеній системі оподаткування, без ПДВ)&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;3.&amp;nbsp;Оплата карткового рахунку&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://lifecars.com.ua/image/data/info/privat-bank.png&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;за покупку у нашому магазині Ви можете оплатити перерахувавши кошти на картковий рахунок у Приват Банку. (зв&amp;rsquo;яжіться з менеджером що надасть Вам додаткову інформації щодо такої оплати)&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;4. Наложеним платежем&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;наложеним платежем можна оплатити товарами, що відправлялися кур&amp;rsquo;єрськими службами Нова Пошта чи САТ в пункті отримання після огляду товару.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;h1&gt;ДОСТАВКА&lt;/h1&gt;\n\n&lt;p&gt;&lt;strong&gt;Ви можете забрати свій товар в одному з наших магазинів:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n	&lt;li&gt;у місті Львові за адресою вул.. Ів. Виговського, 49&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;Також ми можемо відправити Ваш товар в будь-яке місто України кур&amp;rsquo;єрськими службами, таким як Нова Пошта, САТ та Автолюкс.&lt;/p&gt;\n\n&lt;p&gt;Адреси відділень та графік роботи, вартість доставки, Ви можете дізнатись на сайтах компаній перевізників за адресами:&lt;/p&gt;\n\n&lt;table&gt;\n	&lt;tbody&gt;\n		&lt;tr&gt;\n			&lt;td&gt;\n			&lt;p&gt;&lt;a href=&quot;http://novaposhta.ua/&quot; target=&quot;_blank&quot;&gt;ТК &amp;ldquo;НОВА ПОШТА&amp;rdquo;&lt;/a&gt;&lt;/p&gt;\n			&lt;a href=&quot;http://novaposhta.ua/&quot; target=&quot;_blank&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://lifecars.com.ua/image/data/info/delivery1.jpg&quot; /&gt;&lt;/a&gt;&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p&gt;&lt;a href=&quot;http://www.sat.ua/&quot; target=&quot;_blank&quot;&gt;ТК &amp;ldquo;САТ&amp;rdquo;&lt;/a&gt;&lt;/p&gt;\n			&lt;a href=&quot;http://www.sat.ua/&quot; target=&quot;_blank&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://lifecars.com.ua/image/data/info/delivery2.jpg&quot; /&gt;&lt;/a&gt;&lt;/td&gt;\n			&lt;td&gt;\n			&lt;p&gt;&lt;a href=&quot;http://www.autolux.ua/&quot; target=&quot;_blank&quot;&gt;ТК &amp;ldquo;АВТОЛЮКС&amp;rdquo;&lt;/a&gt;&lt;/p&gt;\n			&lt;a href=&quot;http://www.autolux.ua/&quot; target=&quot;_blank&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://lifecars.com.ua/image/data/info/delivery3.jpg&quot; /&gt;&lt;/a&gt;&lt;/td&gt;\n		&lt;/tr&gt;\n	&lt;/tbody&gt;\n&lt;/table&gt;\n', NULL, NULL),
